import "./process.scss";
import { useState, useEffect } from "react";
function Process({ socket }) {
  const [userlist, setUserList] = useState([]);
  useEffect(() => {
    socket.on("userList", (data) => {
      console.log(data,"fffffffffffffffffffffffffffffffffffffff");
      let temp = data;
      setUserList(temp);
    });
  }, [socket]);
  return (
    <div>
      <p>Hello world </p>
      <p>{userlist}</p>
    </div>
  );
}
export default Process;
